description:
In the 'not so distant' future the world is a very different place. Sex is now a very valuable commodity, bought and sold like any other product and all monetary transactions are done via a barcode tattoed on one's wrist. In this &quot;new world&quot; Anika Tate (jessica drake), is one of the most successful purveyors of sexual commerce. However, after a transaction goes awry, her perfect little world starts to crumble. Director Brad Armstrong, jessica drake, and an incredible cast of today's hottest performers bring the chilling tale to life. A fresh look at the world's oldest profession!

